// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'Navbar'.
function Navbar() {
    return (
        // Navbar Container.
        <nav class="navbar navbar-expand-lg navbar-dark bg-steel">
            {/* Navbar Brand */}
            <a id="MainNavBrand" class="navbar-brand" href="/">Shawn Luther</a>
            {/* Mobile Collapse Icon (Hamburger) */}
            <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText"
                aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
                {/* Hamburger Icon */}
                <span class="navbar-toggler-icon"></span>
            </button>
            {/* Navbar Mobile Collapse Container */}
            <div class="collapse navbar-collapse" id="navbarText">
               <h1 className="text-white">My Social Circles</h1>
            </div>
            <div class="collapse navbar-collapse" id="navbarText">
                <ul class="navbar-nav ml-auto nav-flex-icons">
                    {/* Item #1 - 'About Me' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#"><i class="fa fa-info-circle" aria-hidden="true"></i> About Me</a>
                    </li>
                    {/* Item #2 - 'Skills & Projects' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#"><i class="fa fa-code" aria-hidden="true"></i> Skills & Projects</a>
                    </li>
                    {/* Item #3 - 'Contact' */}
                    <li class="nav-item">
                        <a class="nav-link" href="#"><i class="fa fa-address-card" aria-hidden="true"></i> Contact Info</a>
                    </li>
                </ul>
            </div>
        </nav>
    );
}

// Do export.
export default Navbar;
